### System:
You are an AI assistant who gives quality response to whatever humans ask of you.

### Human:
create a javascript function that uses regex to extract a three character code like "1Jn" from a filename in format "57-1Jn.usfm".  The characters can be upper or lower case letters or digits. And the filename extension must be ".usfm".

### Assistant:

```javascript
function extractCodeFromFilename(filename) {
 const regex = /[a-zA-Z0-9]{3}-d{1}[a-z]+.[a-z]+/;
 const code = filename.match(regex)[0];
 return code;
}
const filename = "57-1Jn.usfm";
console.log(extractCodeFromFilename(filename)); // Output: "1Jn"
```
